import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import CustomNavbar from './components/CustomNavbar'; // Make sure to import CustomNavbar correctly
import EventDetails from './components/EventDetails';
import CalendarSidebar from './components/CalendarSidebar';
import Carousel from './components/Carousel';
import Footer from './components/Footer';
import ContactUs from './pages/ContactUs';
import HomePage from './pages/HomePage'; // Assuming this exists
import MyEvents from './pages/MyEvents'; // Assuming this exists
import PastEvents from './pages/PastEvents'; // Assuming this exists
import events from './data/events';
import './App.css';

function App() {
    return (
        <Router>
            <div className="App">
                {/* Navbar */}
                <CustomNavbar />

                {/* Main Content */}
                <div className="container mt-4">
                    <div className="row">
                        <div className="col-md-8 mb-4">
                            <EventDetails events={events} />
                        </div>
                        <div className="col-md-4">
                            <CalendarSidebar events={events} />
                        </div>
                    </div>

                    {/* Routes for different pages */}
                    <Routes>
                        <Route path="/HomePage" element={<HomePage />} />
                        <Route path="/MyEvents" element={<MyEvents />} />
                        <Route path="/PastEvents" element={<PastEvents />} />
                        <Route path="src/Pages/ContactUs" element={<ContactUs />} />
                    </Routes>

                    {/* Carousel */}
                    <Carousel />
                </div>

                {/* Footer */}
                <Footer />
            </div>
        </Router>
    );
}

export default App;
